using api.Domain.Classes;
using api.Domain.DTOs;
using api.Infra.Data;
using Microsoft.EntityFrameworkCore;

namespace api.Services
{
    public class DataSeeder
    {
        private readonly ApplicationDbContext _context;

        public DataSeeder(ApplicationDbContext context)
        {
            _context = context;
        }

        public void Seed()
        {
            string hashedPassword1 = BCrypt.Net.BCrypt.HashPassword("jardeson123");
            string hashedPassword2 = BCrypt.Net.BCrypt.HashPassword("denerson123");


            var idTeam1 = Guid.NewGuid();
            var idTeam2 = Guid.NewGuid();

            var team1 = new Team { Name = "Administradores", Id = idTeam1 };
            var team2 = new Team { Name = "Time Backend", Id = idTeam2 };

            if (!_context.Teams.Any())
            {
                _context.Teams.AddRange(
                    team1,
                    team2
                    );

                _context.SaveChanges();

            }

            if (!_context.Users.Any())
            {
                _context.Users.AddRange(
                    new User { Name = "Jardeson", Email = "jardeson@gmail.com", Password = hashedPassword1, UserType = "admin", Role = "ADM",TeamName = team1.Name, TeamId = idTeam1,Stars = 0, Photo = "data:image/png;base64," },
                    new User { Name = "Denerson", Email = "denerson@gmail.com", Password = hashedPassword2, UserType = "user", Role = "Desenvolvedor Backend",TeamName = team2.Name, TeamId = idTeam2, Stars = 0, Photo = "data:image/png;base64," }

                );

                _context.SaveChanges();
            }
        }
    }
}
